import { useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Logout = () => {
  const navigate = useNavigate();

  useEffect(() => {
    // Clear the local storage token
    localStorage.removeItem("token");
    navigate("/login");
  }, [navigate]);

  return null;
};

export default Logout;
